import React from 'react'
import banner from '../allImages/banner.jpg';
import logo from '../allImages/logo.png';
import { Button } from '@material-ui/core'
import { makeStyles } from '@material-ui/styles'
function HomeScreen() {

    const useStyles = makeStyles(theme=>({
        button:{
            borderRadius:'50px',
            fontFamily: 'Lato',
        },
        navBar:{
            display:'flex',
            justifyContent:'space-between'
        }
    }))

    const classes = useStyles()

    return (
        <div>
            <div className='main' >
                <img src={banner} className='main-image' alt='' ></img>
                <img src={logo} className='logo' alt='' ></img>
                <div className={classes.navBar} >
                    <Button variant='contained' color='primary' className={classes.button}  >Login as Restaurant</Button>
                    <Button variant='contained' color='primary' className={classes.button} >Login as User</Button>
                </div>
            </div>
        </div>
    )
}

export default HomeScreen
